import React from 'react';

function Getproducts () {
    const URL = 'https://fakestoreapi.com/products'
    const products = [];
    fetch(URL)
    .then(response => response.json())
    .then(data => {
        console.log(data);
        products = data;
    })
    .catch(error => console.log(error));
    
  return (
    <div>
      <h1>Products</h1>
    </div>
  );
}

export default Getproducts;
